              props.axalisabolooMoxmareba[i] +
              (props.axalisabolooMoxmareba[i] * props.infoprecent[ar1[i]]) /
                100;
            props.setnewvalue(props.axalisabolooMoxmareba);
          } else {
            // console.log("can't update 1");
          }
        }
